        public UpdateEDTagsCommand(GameCacheHaloOnline cacheContext) : base
        (
            false,
            "UpdateEDTags",
            "Will attempt to correctly name all the tags within an ElDewrito 0.7.1 cache",
            "UpdateEDTags",
            "Will attempt to correctly name all the tags within an ElDewrito 0.7.1 cache"
        )
        {
            CacheContext = cacheContext;
        }

        public override object Execute(List<string> args)
        {
            using (var stream = CacheContext.OpenCacheRead())
            {
                foreach (var tag in CacheContext.TagCache.NonNull())
                {
                    if (tagNameTable.TryGetValue(tag.Index, out string name))
                    {
                        tag.Name = name;
                    }
                }
            }

            CacheContext.SaveTagNames();

            return true;
        }
